                            Description = "\n<h2><strong>Everything you need for your personal Island paradise</strong></h2>\n<p>Escape to a deserted island and create your own paradise as you explore, create, and customize in <em>Animal Crossing: New Horizons</em>. Your island getaway has a wealth of natural resources that can be used to craft everything from tools to creature comforts.</p>\n<p>This Animal Crossing Collector's box contains everything you could need to tend to your real-life everyday chores. There's a Nook Inc. drawstring bag, a bell bag blanket, turnip sticky notes, Isabelle fluffy bed socks and more!</p>\n<p>Grab yours today!</p>\n<h2>Includes:</h2>\n<ul>\n<li>Nook Inc. Drawstring Bag</li>\n<li>Bell Bag Blanket</li>\n<li>Timmy and Tommy Desk Calendar</li>\n<li>Animal Crossing New Horizons Notebook</li>\n<li>Isabelle Fluffy Bed Socks</li>\n<li>Peach Stress ball</li>\n<li>Turnip Sticky Notes</li>\n</ul>\n<h2>Specifications:</h2>\n<ul>\n<li><strong>Blanket Size:</strong>&nbsp;160cm x 101cm approx</li>\n</ul>\n<p>Official Animal Crossing licensed merchandise</p> ",
