                            Category = 2,
                            Description = "\n<div id=\"StrictOne\" class=\"alert-panel alert-panel-warning\">\n<div class=\"alert-panel-sidebar icon-notification\">­</div>\n<div class=\"alert-panel-title\">Strictly 1 per Customer!</div>\n</div>\n<div id=\"StrictOne\" class=\"alert-panel alert-panel-warning\">\n<div class=\"alert-panel-sidebar icon-notification\">­</div>\n<div class=\"alert-panel-title\">Please note: This listing does not include the Tiny Tina's Wonderlands game</div>\n</div>\n<h2><strong>Tiny Tina's Wonderlands: Treasure Trove</strong></h2>\n<p>Gather round, because Tina’s got the one and only collectible box guaranteed to NOT be a mimic that comes to life and eats your whole family. Chockablock full of hand-picked, awe-inspiring, premium loot, Tiny Tina’s Treasure Trove is an instant heirloom that will impress your friends and make your enemies jelly. This collectible box contains limited-edition items.</p>\n<h2>Includes:</h2>\n<ul>\n<li><strong>Butt Stallion Plush:</strong> Our senior scientists and designers used their collective brainpower to bring you this plush rendition of the most beautiful, iconic, and majestic ruler in all the land – Queen Butt Stallion. Kneel before her supreme cuddliness!</li>\n<li><strong>Illustrated Tarot Cards:</strong> Foresee your glorious fate with this deck of elegantly crafted, golden-trimmed tarot cards. This 78-card deck features regal stained-glass designs straight out of Tina’s imagination.</li>\n<li><strong>Standalone Bunkers &amp; Badasses Module:</strong> Delve into the dungeon of your mind with this official Bunkers &amp; Badasses One-shot! Use the power of IMAGINATION to transport you and your friends to a fantastical world as you chomp down a full bag of nutritious cheese curls.</li>\n<li><strong>Enamel Companion Pins:</strong> All the perks of friendship with none of the mess! Bring your loyal minions with you wherever you go with these shiny, oh-so-adorable enamel pins (just watch out for those pointy ends).</li>\n<li><strong>Butt Stallion’s Castle Papercraft Booklet:</strong> The beauty of Butt Stallion’s splendiferous castle is said to reduce even the most hard-hearted ogre to tears. Now you can recreate that magical experience in your own home with this papercraft rendition – just remember it’s made of paper, so tears of joy will damage the materials.</li>\n<li><strong>Cloth Wonderlands Map:</strong> Whether you’re an enterprising pirate or an adventurous explorer, everybody loves a good map. Get ready to bask in this beautifully illustrated, 18'x30' piece of chaotic cartography depicting the many SPOILERS you may encounter during your ventures ‘cross the Wonderlands.</li>\n</ul>\n<p><strong><em>*Please note that the Treasure Trove does not include a copy of the game.</em></strong></p> ",
